import numpy as np

class StochasticGradientDescent:
    def __init__(self, learning_rate=0.01, max_epochs=100, batch_size=32, tol=1e-4):
        self.learning_rate = learning_rate
        self.max_epochs = max_epochs
        self.batch_size = batch_size
        self.tol = tol
        self.w = None  # Model parameters

    def fit(self, X, y):
        n_samples, n_features = X.shape
        self.w = np.zeros(n_features)  # Initialize weights

        for epoch in range(self.max_epochs):
            # Shuffle data
            indices = np.random.permutation(n_samples)
            X_shuffled = X[indices]
            y_shuffled = y[indices]

            # Mini-batch SGD
            for start in range(0, n_samples, self.batch_size):
                end = start + self.batch_size
                X_batch = X_shuffled[start:end]
                y_batch = y_shuffled[start:end]

                # Compute gradient
                gradient = self.compute_gradient(X_batch, y_batch)

                # Update weights
                self.w -= self.learning_rate * gradient

            # Check convergence
            if np.linalg.norm(gradient) < self.tol:
                break

    def compute_gradient(self, X_batch, y_batch):
        n_batch = len(X_batch)
        y_pred = np.dot(X_batch, self.w)
        error = y_pred - y_batch
        gradient = np.dot(X_batch.T, error) / n_batch
        return gradient

    def predict(self, X):
        return np.dot(X, self.w)

