"""#Stochastic Mirror Descent"""

import numpy as np

class StochasticMirrorDescent:
    def __init__(self, learning_rate=0.1, max_epochs=100, regularization=None):
        self.learning_rate = learning_rate
        self.max_epochs = max_epochs
        self.regularization = regularization
        self.theta = None  # Dual variable

    def fit(self, X, y):
        n_samples, n_features = X.shape
        self.theta = np.zeros(n_features)  # Initialize dual variable

        for epoch in range(self.max_epochs):
            # Shuffle data
            indices = np.random.permutation(n_samples)
            X_shuffled = X[indices]
            y_shuffled = y[indices]

            # Stochastic Mirror Descent update
            for i in range(n_samples):
                x_i = X_shuffled[i]
                y_i = y_shuffled[i]

                # Compute gradient
                gradient = self.compute_stochastic_gradient(x_i, y_i)

                # Update dual variable using Mirror Descent update
                self.theta = self.mirror_descent_update(self.theta, gradient)

    def compute_stochastic_gradient(self, x_i, y_i):
        # Compute gradient of the squared loss
        gradient = x_i * (np.dot(self.theta, x_i) - y_i)
        return gradient

    def mirror_descent_update(self, theta, gradient):
        # Perform Mirror Descent update
        if self.regularization is None:
            theta = theta - self.learning_rate * gradient
        else:
            # Apply proximal mapping for regularization
            theta_update = theta - self.learning_rate * gradient
            theta = self.regularization.proximal_mapping(theta_update, self.learning_rate)
        return theta

    def predict(self, X):
        return np.dot(X, self.theta)

# Define L1 regularization proximal mapping
class L1Regularization:
    def __init__(self, lmbda):
        self.lmbda = lmbda

    def proximal_mapping(self, v, t):
        return np.sign(v) * np.maximum(np.abs(v) - self.lmbda * t, 0)

