# Define L2 regularization proximal mapping (ridge shrinkage)
class L2Regularization:
    def __init__(self, lmbda):
        self.lmbda = lmbda

    def proximal_mapping(self, v, t):
        # Apply L2 (ridge) shrinkage
        return v / (1 + self.lmbda * t)

