"""#Stochastic coordinate descent"""

import numpy as np

class StochasticCoordinateDescent:
    def __init__(self, learning_rate=0.1, max_epochs=100, coordinate_update_prob=0.5):
        self.learning_rate = learning_rate
        self.max_epochs = max_epochs
        self.coordinate_update_prob = coordinate_update_prob
        self.w = None  # Model parameters

    def fit(self, X, y):
        n_samples, n_features = X.shape
        self.w = np.zeros(n_features)  # Initialize weights

        for epoch in range(self.max_epochs):
            for i in range(n_features):
                if np.random.rand() < self.coordinate_update_prob:
                    # Select a random coordinate to update
                    gradient = self.compute_stochastic_gradient(X, y, i)
                    self.w[i] -= self.learning_rate * gradient

    def compute_stochastic_gradient(self, X, y, coordinate_idx):
        # Compute stochastic gradient for the given coordinate index
        n_samples = X.shape[0]
        gradient = 0
        for j in range(n_samples):
            prediction = np.dot(X[j], self.w)
            error = prediction - y[j]
            gradient += X[j][coordinate_idx] * error
        return gradient / n_samples

    def predict(self, X):
        return np.dot(X, self.w)

